    and profile data collected aboard the MELVILLE during cruise MV1202 in the Indian
    Ocean from 2012-01-23 to 2012-02-08. These data include CONDUCTIVITY, SALINITY and
    WATER TEMPERATURE. The instruments used to collect these data include CTD. These
    data were collected by Warren Wood of US Navy; Naval Research Laboratory - Stennis
    MS, and by University of California - San Diego; Scripps Institution of Oceanography
    as part of Seismic Oceanography of Agulhas Mixing. The Lamont-Doherty Earth Observatory
